import Header from "./Header";
import './App.css';
import Home from "./Home";
import {
  BrowserRouter,
  Routes, 
  Route,
} from "react-router-dom";



function App() {
  return (

    <BrowserRouter>
    <Routes>
      <Route path="/" element={<Header /> , <Home />} />
      <Route path="/checkout" element={<h1>checkout page</h1>} />

    </Routes>
  </BrowserRouter>





  //   {/* <div className="App">

  //  <Header />
  //  <Home />
  //   </div> */}
  );
}

export default App;
